Binary comparison operators are denoted by expressions with a type field of binary_comparison_operator. The set of available operators depends on the type of the column involved in the expression. The operator property should specify the name of one of the binary operators from the field's scalar type definition. The type ComparisonValue describes the valid inhabitants of the value field. The value field should be an expression which evaluates to a value whose type is compatible with the definition of the comparison operator. Equality Operators This example makes use of an eq operator, which is defined using the equal semantics, to test a single column for equality with a scalar value: { "collection": "articles", "arguments": {}, "query": { "fields": { "id": { "type": "column", "column": "id" }, "title": { "type": "column", "column": "title" } }, "predicate": { "type": "binary_comparison_operator", "column": { "type": "column", "name": "id" }, "operator": "eq", "value": { "type": "scalar", "value": 1 } } }, "collection_relationships": {}
} Set Membership Operators This example uses an in operator, which is defined using the in semantics, to test a single column for membership in a set of values: { "collection": "articles", "arguments": {}, "query": { "fields": { "id": { "type": "column", "column": "id" }, "title": { "type": "column", "column": "title" } }, "predicate": { "type": "binary_comparison_operator", "column": { "type": "column", "name": "author_id" }, "operator": "in", "value": { "type": "scalar", "value": [1, 2] } } }, "collection_relationships": {}
} Custom Operators This example uses a custom like operator: { "collection": "articles", "arguments": {}, "query": { "fields": { "id": { "type": "column", "column": "id" }, "title": { "type": "column", "column": "title" } }, "predicate": { "type": "binary_comparison_operator", "column": { "type": "column", "name": "title" }, "operator": "like", "value": { "type": "scalar", "value": "Functional" } } }, "collection_relationships": {}
}

