If the connector declares support for the query.nested_fields.filter_by.nested_arrays capability, it can receive expressions of type array_comparison. These expressions allow scalar array-specific comparisons against columns that contain an array of scalar values. There are two supported comparison operators that connectors can declare support for: contains: Whether or not the array contains the specified scalar value. This must be supported for all types that can be contained in an array that implement an 'eq' comparison operator. Capability: query.nested_fields.filter_by.nested_arrays.contains is_empty: Whether or not the array is empty. This must be supported no matter what type is contained in the array. Capability: query.nested_fields.filter_by.nested_arrays.is_empty This example finds institutions where the nested location.campuses array contains the Lindholmen value: { "collection": "institutions", "arguments": {}, "query": { "fields": { "id": { "type": "column", "column": "id" }, "name": { "type": "column", "column": "name" }, "location": { "type": "column", "column": "location", "fields": { "type": "object", "fields": { "campuses": { "type": "column", "column": "campuses", "arguments": { "limit": { "type": "literal", "value": null } } } } } } }, "predicate": { "type": "array_comparison", "column": { "type": "column", "name": "location", "field_path": ["campuses"] }, "comparison": { "type": "contains", "value": { "type": "scalar", "value": "Lindholmen" } } } }, "collection_relationships": {}
} This example finds countries which have an empty cities array: { "collection": "countries", "arguments": {}, "query": { "fields": { "id": { "type": "column", "column": "id" }, "name": { "type": "column", "column": "name" }, "cities": { "type": "column", "column": "cities", "arguments": { "limit": { "type": "literal", "value": null } } } }, "predicate": { "type": "array_comparison", "column": { "type": "column", "name": "cities", "arguments": { "limit": { "type": "literal", "value": null } } }, "comparison": { "type": "is_empty" } } }, "collection_relationships": {}
}

