Related collections are related to the original collection by a relationship in the collection_relationships field of the top-level QueryRequest . For example, this query fetches authors who have written articles whose titles contain the string "Functional": { "collection": "authors", "arguments": {}, "query": { "fields": { "first_name": { "type": "column", "column": "first_name" }, "last_name": { "type": "column", "column": "last_name" }, "articles": { "type": "relationship", "arguments": {}, "relationship": "author_articles", "query": { "fields": { "id": { "type": "column", "column": "id" }, "title": { "type": "column", "column": "title" } } } } }, "predicate": { "type": "exists", "in_collection": { "type": "related", "arguments": {}, "relationship": "author_articles" }, "predicate": { "type": "binary_comparison_operator", "column": { "type": "column", "name": "title" }, "operator": "like", "value": { "type": "scalar", "value": "Functional" } } } }, "collection_relationships": { "author_articles": { "arguments": {}, "column_mapping": { "id": ["author_id"] }, "relationship_type": "array", "source_collection_or_type": "author", "target_collection": "articles" } }
} Nested relationships If the related collection is related from a field inside a nested object, then the field path to the nested object can be first descended through using field_path before the relationship is navigated. Only connectors that enable the relationships.nested.filtering capability will receive these sorts of queries. In this example, the relationship joins from the nested location.country_id across to the id column on the countries collection. { "collection": "institutions", "arguments": {}, "query": { "fields": { "name": { "type": "column", "column": "name" }, "location": { "type": "column", "column": "location", "fields": { "type": "object", "fields": { "country_id": { "type": "column", "column": "country_id" }, "country": { "type": "relationship", "relationship": "location_country", "arguments": {}, "query": { "fields": { "id": { "type": "column", "column": "id" }, "name": { "type": "column", "column": "name" }, "area_km2": { "type": "column", "column": "area_km2" } } } } } } } }, "predicate": { "type": "exists", "in_collection": { "type": "related", "field_path": ["location"], "relationship": "location_country", "arguments": {} }, "predicate": { "type": "binary_comparison_operator", "column": { "type": "column", "name": "area_km2" }, "operator": "gt", "value": { "type": "scalar", "value": 300000 } } } }, "collection_relationships": { "location_country": { "arguments": {}, "column_mapping": { "country_id": ["id"] }, "relationship_type": "object", "target_collection": "countries" } }
}

