The property element.target.name refers to a column name. If the connector supports capability query.nested_fields.order_by then the target may also reference nested fields within a column using the field_path property. If the column has arguments , the the arguments property is used to provide values for the arguments. If element.order_direction is asc, then the row with the smaller column comes first. If element.order_direction is asc, then the row with the smaller column comes second. If the column values are incomparable, continue to the next OrderByElement . The data connector should document, for each scalar type, a comparison function to use for any two values of that scalar type. For example, a data connector might choose to use the obvious ordering for a scalar integer-valued type, but to use the database-given ordering for a string-valued type, based on a certain choice of collation. For example, the following query requests that a collection of articles be ordered by title descending: { "collection": "articles", "arguments": {}, "query": { "fields": { "id": { "type": "column", "column": "id" }, "title": { "type": "column", "column": "title" } }, "order_by": { "elements": [ { "target": { "type": "column", "name": "title", "path": [] }, "order_direction": "desc" } ] } }, "collection_relationships": {}
} The selected column can be chosen from a related collection by specifying the path property. path consists of a list of named relationships . For example, this query sorts articles by their author's last names, and then by their first names, by traversing the relationship from articles to authors: { "collection": "articles", "arguments": {}, "query": { "fields": { "id": { "type": "column", "column": "id" }, "title": { "type": "column", "column": "title" }, "author": { "type": "relationship", "arguments": {}, "relationship": "article_author", "query": { "fields": { "first_name": { "type": "column", "column": "first_name" }, "last_name": { "type": "column", "column": "last_name" } } } } }, "order_by": { "elements": [ { "target": { "type": "column", "name": "last_name", "path": [ { "arguments": {}, "relationship": "article_author", "predicate": { "type": "and", "expressions": [] } } ] }, "order_direction": "asc" }, { "target": { "type": "column", "name": "first_name", "path": [ { "arguments": {}, "relationship": "article_author", "predicate": { "type": "and", "expressions": [] } } ] }, "order_direction": "asc" } ] } }, "collection_relationships": { "article_author": { "arguments": {}, "column_mapping": { "author_id": ["id"] }, "relationship_type": "object", "source_collection_or_type": "article", "target_collection": "authors" } }
} Nested relationships If the connector enables the relationships.nested.ordering capability, it may receive path relationships where the relationship starts from inside a nested object. The path to descend through the nested objects before navigating the relationship is specified by the field_path property. For example, this query sorts institutions by their location's country's area. The relationship starts from within the location nested object and joins its country_id column to the countries collection's id column. { "collection": "institutions", "arguments": {}, "query": { "fields": { "name": { "type": "column", "column": "name" }, "location": { "type": "column", "column": "location", "fields": { "type": "object", "fields": { "country_id": { "type": "column", "column": "country_id" }, "country": { "type": "relationship", "arguments": {}, "relationship": "location_country", "query": { "fields": { "id": { "type": "column", "column": "id" }, "name": { "type": "column", "column": "name" }, "area_km2": { "type": "column", "column": "area_km2" } } } } } } } }, "order_by": { "elements": [ { "order_direction": "desc", "target": { "type": "column", "path": [ { "field_path": ["location"], "relationship": "location_country", "arguments": {}, "predicate": null } ], "name": "area_km2", "field_path": [] } } ] } }, "collection_relationships": { "location_country": { "arguments": {}, "column_mapping": { "country_id": ["id"] }, "relationship_type": "object", "target_collection": "countries" } }
}

