An ordering of type aggregate orders rows by aggregating rows in some related collection , and comparing aggregations for each of the two rows. The relationship path is specified by the path property. Connectors must enable the relationships.order_by_aggregate capability to receive this ordering type. If the respective aggregates are incomparable, the ordering should continue to the next OrderByElement . If the connector enables the relationships.nested.ordering capability, it may receive path relationships where the relationship starts from inside a nested object. The path to descend through the nested objects before navigating the relationship is specified by the field_path property. Examples For example, this query sorts article authors by their total article count: { "collection": "authors", "arguments": {}, "query": { "fields": { "first_name": { "type": "column", "column": "first_name" }, "last_name": { "type": "column", "column": "last_name" }, "articles_aggregate": { "type": "relationship", "arguments": {}, "relationship": "author_articles", "query": { "aggregates": { "count": { "type": "star_count" } } } } }, "order_by": { "elements": [ { "order_direction": "desc", "target": { "type": "aggregate", "aggregate": { "type": "star_count" }, "path": [ { "arguments": {}, "relationship": "author_articles", "predicate": { "type": "and", "expressions": [] } } ] } } ] } }, "collection_relationships": { "author_articles": { "arguments": {}, "column_mapping": { "id": ["author_id"] }, "relationship_type": "array", "source_collection_or_type": "author", "target_collection": "articles" } }
} This query sorts article authors by their maximum article ID: { "collection": "authors", "arguments": {}, "query": { "fields": { "first_name": { "type": "column", "column": "first_name" }, "last_name": { "type": "column", "column": "last_name" }, "articles_aggregate": { "type": "relationship", "arguments": {}, "relationship": "author_articles", "query": { "aggregates": { "max_id": { "type": "single_column", "column": "id", "function": "max" } } } } }, "order_by": { "elements": [ { "order_direction": "asc", "target": { "type": "aggregate", "aggregate": { "type": "single_column", "column": "id", "function": "max" }, "path": [ { "arguments": {}, "relationship": "author_articles", "predicate": { "type": "and", "expressions": [] } } ] } } ] } }, "collection_relationships": { "author_articles": { "arguments": {}, "column_mapping": { "id": ["author_id"] }, "relationship_type": "array", "source_collection_or_type": "author", "target_collection": "articles" } }
} This query sorts institutions first by those institutions that are in countries that have the most institutions in them, then by the institutions' name. This example navigates the nested relationship that begins in the location nested object and joins back onto the institutions collection, targeting the nested location.country_id property. { "collection": "institutions", "arguments": {}, "query": { "fields": { "name": { "type": "column", "column": "name" }, "location": { "type": "column", "column": "location", "fields": { "type": "object", "fields": { "country_id": { "type": "column", "column": "country_id" }, "country": { "type": "relationship", "arguments": {}, "relationship": "location_institution_location_country", "query": { "fields": { "name": { "type": "column", "column": "name" }, "location": { "type": "column", "column": "location" } } } } } } } }, "order_by": { "elements": [ { "order_direction": "desc", "target": { "type": "aggregate", "path": [ { "field_path": ["location"], "relationship": "location_institution_location_country", "arguments": {}, "predicate": null } ], "aggregate": { "type": "star_count" } } }, { "order_direction": "desc", "target": { "type": "column", "name": "name", "path": [] } } ] } }, "collection_relationships": { "location_institution_location_country": { "arguments": {}, "column_mapping": { "country_id": ["location", "country_id"] }, "relationship_type": "array", "target_collection": "institutions" } }
}

