Now that we have reduced the problem to a single set of query variables, we must evaluate any collection arguments , and in turn, evaluate the collection of rows that we will be working with. From there, we will be able to apply predicates, sort and paginate rows. But one step at a time! The first step is to evaluate each argument, which the execute_query_with_variables function does by delegating to the eval_argument function: fn execute_query_with_variables( collection: &models::CollectionName, arguments: &BTreeMap<models::ArgumentName, models::Argument>, collection_relationships: &BTreeMap<models::RelationshipName, models::Relationship>, query: &models::Query, variables: &BTreeMap<models::VariableName, serde_json::Value>, state: &AppState,
