) -> std::result::Result<models::MutationOperationResults, (StatusCode, Json<models::ErrorResponse>)>
{ let article = arguments.get("article").ok_or(( StatusCode::BAD_REQUEST, Json(models::ErrorResponse { message: "Expected argument 'article'".into(), details: serde_json::Value::Null, }), ))?; let article_obj: Row = serde_json::from_value(article.clone()).map_err(|_| { ( StatusCode::BAD_REQUEST, Json(models::ErrorResponse { message: "article must be an object".into(), details: serde_json::Value::Null, }), ) })?; let id = article_obj.get("id").ok_or(( StatusCode::BAD_REQUEST, Json(models::ErrorResponse { message: "article missing field 'id'".into(), details: serde_json::Value::Null, }), ))?; let id_int = id .as_i64() .ok_or(( StatusCode::BAD_REQUEST, Json(models::ErrorResponse { message: "id must be an integer".into(), details: serde_json::Value::Null, }), ))? .try_into() .map_err(|_| { ( StatusCode::BAD_REQUEST, Json(models::ErrorResponse { message: "id out of range".into(), details: serde_json::Value::Null, }), ) })?; let old_row = state.articles.insert(id_int, article_obj); Ok(models::MutationOperationResults::Procedure { result: old_row.map_or(Ok(serde_json::Value::Null), |old_row| { let old_row_value = serde_json::to_value(old_row).map_err(|_| { ( StatusCode::INTERNAL_SERVER_ERROR, Json(models::ErrorResponse { message: "cannot encode response".into(), details: serde_json::Value::Null, }), ) })?; let old_row_fields = match fields { None => Ok(models::RowFieldValue(old_row_value)), Some(nested_field) => eval_nested_field( collection_relationships, &BTreeMap::new(), state, old_row_value, nested_field, ), }?; Ok(old_row_fields.0) })?, })
